                <div className="images">
                </div>
                <div className={classes.container}>
                    <Profile />
                    <div className={classes.blockFast}>
                        <div className={classes.item}><p>My posts</p></div>
                        <div className={classes.textPole}>
                            <textarea></textarea>
                        </div>
                        <div className={classes.buttonAdd}>
                            <button>Send</button>
                        </div>
                    </div>
                    <Post />
                    <Post />
                    <Post />
                </div>
            </div>
        );
        }
        export  default Content;
